import cvPic from '../pictures/IMG_0041.jpg'
import React from "react";
import AppBar from '@mui/material/AppBar';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import Toolbar from '@mui/material/Toolbar';
import IconButton from '@mui/material/IconButton';
import FacebookIcon from '@mui/icons-material/Facebook';
import InstagramIcon from '@mui/icons-material/Instagram';

const Home = () => {

    return (
        <>
        <div>
           <h1>Erik Torvbråten</h1>
        </div>
        <section>
            <img src={cvPic} alt="Suitpicture" width={400} height={500} />
        </section>

        <section>
            <p>My name is Erik Torvbråten and I am 21 years old. I am on my second year of a M.Sc Computer Science degree at NTNU in Trondheim.</p>
        </section>

    <AppBar position="fixed" color="primary" sx={{ top: 'auto', bottom: 0 }} className={'BottomBar'}>
        <Toolbar>
          <IconButton color="inherit" aria-label="open drawer" >
            <LinkedInIcon />
          </IconButton>
          <IconButton color="inherit" aria-label="open drawer" >
            <FacebookIcon />
          </IconButton>
          <IconButton color="inherit" aria-label="open drawer" >
            <FacebookIcon />
          </IconButton>
          <IconButton color="inherit" aria-label="open drawer" >
            <FacebookIcon />
          </IconButton>
        </Toolbar>
      </AppBar>

        </>

    );
}

export default Home;
